import React from 'react';
import SectionTitle from '../components/SectionTitle';
import NavBar  from '../components/NavBar';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {  faHtml5, faJava, faReact, faBootstrap } from '@fortawesome/free-brands-svg-icons';



const SkillsPage = (props) => {
    return (
        <main>
            <NavBar/>
            <SectionTitle title={props.title}/>
            <section class="resume-section" id="skills">
                <div class="resume-section-content">
                    <div class="subheading mb-3">
                        <h1>Programming Languages</h1>
                        <h1><FontAwesomeIcon icon={faHtml5}/></h1>
                        <h1><FontAwesomeIcon icon={faBootstrap}/></h1>
                        <h1><FontAwesomeIcon icon={faReact}/></h1>
                        <h1><FontAwesomeIcon icon={faJava}/></h1>
                    </div>
                    <div class="subheading mb-3">
                        <h1>Frameworks</h1>
                    </div>
                    <div class="subheading mb-3">
                        <h1>Other</h1>
                    </div>
                </div>  






            </section>
        </main>

    )
}

export default SkillsPage;
